import React from "react";
import PropTypes from "prop-types";
// css
import "./Videos.scss";

function Videos(props) {
  return (
    <main className="index">
      <video src="assets/videos/lambo_gift.mp4"></video>
    </main>
  );
}

Videos.propTypes = {};

export default Videos;
